آقای هاسکینسون بنیانگذار کاردانو در ویدیویی که امروز صبح در یوتیوب منتشر کرد، در مورد وضعیت فعلی بازار گفت:
اوایل شیوع ویروس کرونا مردم از اینکه نمیتوانستند خودشان را با شرایط وفق دهند، ناراحت بودند اما به مرور زمان به آن عادت کردند.

وی در ادامه افزود:
وضعیت اقتصادی امروز در شرایط مناسبی نیست و واقعیت این است که این شرایط باعث شده که صنعت از بین برود و مشکلاتی بوجود آید.

ولی نظر مردم درباره‌ی بلاکچین چیست؟
اکثر مردم خصوصا در شهرهای بزرگ تقاضای کمک و راه‌حل دارند.
اگر به جامعه دقت کنیم مردم دل خوشی از جامعه و اقتصاد ندارند.

او در ادامه راه حل را اینچنین توصیف کرد:
اگر به اطراف نگاه کنیم متوجه میشویم که رمزارز در تمام جهان در حال فراگیری است و این روزها چالشی را برای ما رقم زده که باید در آن به پیروزی برسیم.

وی در ادامه هدفش از انتشار ویدیوی مذکور را چنین بیان کرد:
که بگم چرا من اینجا هستم و چرا شما باید اینجا باشید؟
شما باید ببینید آیا از وضعیت جامعه خوشحالید؟
آیا با پولی که دارید خوشحالید؟
آیا با فکر کردن به آینده حس خوبی دارید؟
خیلی از آدم‌ها حس خوبی به آینده ندارند و نمیخواهند آینده اتفاق بیافتد.
و ما باید قبول کنیم که ارزش پول هر سال کمتر میشود.
فقط باید رو به جلو حرکت کنیم و جامعه را با تلاش‌هایمان بسازیم.
روزی فرا خواهد رسید که جامعه‌ایی بهتر خواهیم داشت، و همه‌ی ما ثروتمند خواهیم شد.
قطعا فرداها بهتر از امروز خواهند بود.

